                    needRefresh = true;
                    var oldWidth = imgNode.width;
                    var oldHeight = imgNode.height;
                    var newWidth = size;
                    var newHeight = newWidth * oldHeight / oldWidth;
                    css.width = Utility.int(newWidth);
                    css.height = Utility.int(newHeight);
