define("pai/1.0.301/widget/follow/index-debug", [ "$-debug", "pai/1.0.301/common/view-debug", "utility/backbone/1.1.2/backbone-debug", "utility/handlebars/1.3.0/runtime-debug", "pai/1.0.301/common/utility-debug", "pai/1.0.301/common/cross_domain_storage-debug", "matcha/cookie/1.0.0/cookie-debug", "utility/underscore/1.6.0/underscore-debug", "pai/1.0.301/frame/ua-debug", "pai/1.0.301/common/global_config-debug" ], function(require, exports, module) {
    var $ = require("$-debug");
    var View = require("pai/1.0.301/common/view-debug");
    var utility = require("pai/1.0.301/common/utility-debug");
    var global_config = require("pai/1.0.301/common/global_config-debug");
    var follow_tpl = require("pai/1.0.301/widget/follow/main-debug.handlebars");
    module.exports = View.extend({
        attrs: {
            template: follow_tpl
        },
        events: {},
        setup: function() {
            var self = this;
        },
        show: function() {
            var self = this;
            self.$el.removeClass("fn-hide");
        },
        hide: function() {
            var self = this;
            self.$el.addClass("fn-hide");
        },
        render: function() {
            var self = this;
            // 调用渲染函数
            View.prototype.render.apply(self);
            self.trigger("render");
            self._render_item({
                key: self.get("follow_status")
            });
            return self;
        },
        _render_item: function(data) {
            var self = this;
            var key = data.key || "";
            var tpl = "";
            // 清空旧状态
            self.$el.html("");
            // 0 代表未关注
            // 1 代表已经关注
            // 2 代表相互关注
            switch (utility.int(key)) {
              case 2:
                tpl = '<div class="ui-follow-mod ui-eachotherfollow-mod" data-role="focus" data-focus-type="each"><i class="icon icon-ui-eachotherfollow-m"></i> <span class="txt">相互关注</span></div>';
                break;

              case 1:
                tpl = '<div class="ui-follow-mod ui-hasfollow-mod" data-role="focus" data-focus-type="focused"><i class="icon icon-ui-hasfollow-m"></i> <span class="txt">已关注</span></div>';
                break;

              case 0:
                tpl = '<div class="ui-follow-mod" data-role="focus" data-focus-type="to_focuse"><i class="icon icon-ui-follow-m"></i> <span class="txt">关注</span></div>';
                break;
            }
            self.$el.html(tpl);
            return self;
        },
        follow_action: function(data, opt) {
            var self = this;
            utility.ajax_request({
                url: global_config.ajax_url.follow_user,
                data: data,
                cache: false,
                beforeSend: function(xhr, options) {
                    self.trigger("before:fetch_follow", xhr, options);
                },
                success: function(collection, response, options) {
                    self.trigger("success:fetch_follow", collection, options);
                },
                error: function(collection, response, options) {
                    self.trigger("error:fetch_follow", response, options);
                },
                complete: function(xhr, status) {
                    self.trigger("complete:fetch_follow", xhr, status);
                }
            });
        }
    });
});

