                var table_id = self.action_choosen_group_view.get_value()[0].id;
                var wrong_txt;
                pay_arr.phone || (wrong_txt = "请输入手机号");
                pay_arr.phone.length == 11 || (wrong_txt = "请输入11位手机的号");
                self.action_choosen_group_view.get_value()[0].id || (wrong_txt = "请选择一个组");
